import React, { Component } from 'react';
import PropTypes from 'prop-types';

import "../css/BetCard.css";

class BetCard extends Component {

    getFee(percent) {
        let res = 100 / percent;

        return Math.round(res * 100) / 100;
    }

    render() {
        let eInfo = this.props.eventInfo;

        return (
            <div id={eInfo.Name} className="col-md-4">
                <div className="card myCard">
                    <img className="card-img-top" src="img/Basic_Event.png" alt="Card image cap" />
                    <div className="card-body">
                        <h4 className="card-title">{eInfo.Name}</h4>
                        <h5 className="card-title">{eInfo.Place}</h5>

                        <div className="btn-group myButtonGroup">
                            <span className="badge badge-primary myButtonGroup">{eInfo.Team1}</span>
                            <span className="badge badge-secondary myButtonGroup">Tie</span>
                            <span className="badge badge-primary myButtonGroup">{eInfo.Team2}</span>
                        </div>

                        <div className="btn-group myButtonGroup" role="group" aria-label="Basic example">
                            <button type="button" className="btn btn-primary myButtonOnGroup">{"" + this.getFee(eInfo.Prob1)}</button>
                            <button type="button" className="btn btn-secondary myButtonOnGroup">{"" + this.getFee(eInfo.Tie)}</button>
                            <button type="button" className="btn btn-primary myButtonOnGroup">{"" + this.getFee(eInfo.Prob2)}</button>
                        </div>


                        <hr className="my-4" />

                        <button className="btn btn-outline-info myCardButton" type="submit">More info</button>
                    </div>
                </div>
            </div>
        );
    }
}

BetCard.propTypes = {
    betInfo: PropTypes.object.isRequired
}

export default BetCard;
